import React from 'react'
import { Link } from 'react-router-dom';

function GenerateReport() {
    return(
        <div>

            <Link to="/generate-report/users"><button className="btn btn-primary btn-block">Users</button></Link>
            <br />
            <Link to=""><button className="btn btn-primary btn-block">Staff</button></Link>
            <br />
            <Link to=""><button className="btn btn-primary btn-block">Rooms</button></Link>
        </div>
    )
    
}

export default GenerateReport;
